import React from 'react';
import logo from './logo.svg';
import './App.css';
import axios from "axios";

class App extends React.Component {
  constructor(){
    super();
    this.state = {
      students : []
    }
  }
  componentDidMount() {
    axios.get("http://localhost:8000/api/students/").then(
      data=>{
        let students =data.results.map(((id) => {
          return(
            <div key={id.results}>
                <p>{id.student_id}</p>
            </div>
          )
        }))
        this.setState({students: students})
      }
    )
  }
  render(){
    return (
      <div className="App">
        <header className="App-header">
         <div>
           {this.state.students}
         </div>
        </header>
      </div>
    );
  }

}

export default App;
